import React from 'react';
import logo from './logo.svg';
import './App.css';

function App2() {
  return (
    <div className="App">
      <h1> Welcome to teh Pokemon Adoption Center (Test)</h1>

      <div className='App-mainsection'> 
        <h2>Pokemon Explorer</h2>

      </div>
      <div className='App-mainsection'> 
        <h2>Meet the Caretakers</h2>

        <table>
          <tr>
              <th>Name</th>
          </tr>
          <tr></tr>
        </table>
      </div>
      <div className='App-mainsection'> 
        <h2>Item Shop</h2>

      </div>
      <div className='App-mainsection'> 
        <h2>TBD</h2>

      </div>
    </div>
  );
}

export default App2;
